import { useFetch } from "../services/useFetch"

export const Task9 = () =>{
    const { data, isErrors,isLoading } = useFetch('https://jsonplaceholder.typicode.com/todos');
    console.log(data);
    return(
        <>
            <select className="form-select mt-3 mb-2" aria-label="Default select example">
                <option value="1">One</option>
                <option value="2">Two</option>
                <option value="3">Three</option>
            </select>
            {isLoading && <div>Please waiting to minutes</div>}
            {isErrors && <div>Server 500</div>}
            {data && data.length > 0 && data.map(item => (
                <p>TITLE: {item.title} {item.completed ? <small>isComplated</small> : <small>isNotCompleted</small>}</p>
            ))}
        </>
    )
}
